INSERT INTO `aggregator_item` (`iid`, `fid`, `title`, `link`, `author`, `description`, `timestamp`, `guid`)
VALUES
	(1,1,'Penthouse Magazine Bankruptcy – Bankruptcy Lawyer’s Letter','http://blogs.abi.org/node/16839','ABI Partner','<p><a href=\"http://www.latimes.com/business/la-fi-penthouse-bankruptcy-20130918,0,7859923.story\" target=\"_blank\"><strong>The Los Angeles Times</strong> </a>reports that Penthouse publisher <strong>FriendFinder</strong> filed for bankruptcy protection. I have been a <a href=\"http://www.bayerwishmanbankruptcylaw.com/\" target=\"_blank\">Los Angeles Bankruptcy lawyer</a> for 34 years. Celebrity bankruptcy cases  are nothing new in Tinseltown. My firm has hadled several. But the Penthouse Magazine Bankruptcy has to make us stop and think.</p>\n<p><a href=\"http://www.bankruptcyblogger.org/wp-content/uploads/2013/10/AtTheCheckout.jpg\"><img class=\" wp-image-7196\" src=\"http://www.bankruptcyblogger.org/wp-content/uploads/2013/10/AtTheCheckout-150x150.jpg\" alt=\"Penthouse Magazine Bankruptcy\" width=\"105\" height=\"86\" /></a><br />\n&#8220;You&#8217;re not buying Penthouse any more?&#8221;</p>\n<p>Is the economy so bad that nothing is selling &#8212; not even sex?</p>\n<p><a href=\"http://blogs.abi.org/node/16839\" target=\"_blank\">read more</a></p>',1381354253,'16839 at http://blogs.abi.org'),
	(2,1,'Yellen\'s Lesson for Women in Banking','http://blogs.abi.org/node/16837','ABI Partner','<p>Janet Yellen shouldn\'t have needed anyones help to be nominated to lead the Fed. Her tortuous path underscores the importance of rallying around qualified women candidates for industry leadership positions.</p>',1381358760,'16837 at http://blogs.abi.org'),
	(3,1,'Afraid That Filing Bankruptcy Will Get You Fired From Your Job???  Is There a Bankruptcy Effect on Employment?','http://blogs.abi.org/node/16841','ABI Partner','<p>So how does bankruptcy effect Employment status?  11 USC Section 525 gives an explanation of that.  The bankruptcy effect on employment is thus:<br />\n<strong>Private Employers</strong><br />\n525(b) says that no private employer may terminate SOLEY because of a bankruptcy.  So that means bankruptcy can actually be a reason but it cannot be the only reason.   It also says that no private employer may discriminate with respect to employment solely because of BK.<br />\n<strong>Government Jobs</strong><br />\nUnder 525(a), the government must similarly abide by the same expectations a private employer has with respect to discriminating or terminating an employee who has filed BK or a potential employee who has filed a BK.<br />\nNow if one hasn&#8217;t filed BK but let the cat out of the bag?  Perhaps that isn&#8217;t covered under 525.  Perhaps an employer can discriminate against those contemplating a BK.   That&#8217;s a highly unlikely scenario but it needs to be considered.<br />\n<strong>Conclusion</strong><br />\nIn most bankruptcy attorneys&#8217; experience, job discrimination or loss of employment is rare, but it has happened before.   However, always remember an employer cannot do so <em><strong>SOLELY</strong></em> because the debtor is a bankrupt or was a bankruptcy.<br />\n&nbsp;<br />\n&nbsp;</p>\n<p><a href=\"http://blogs.abi.org/node/16841\" target=\"_blank\">read more</a></p>',1381369513,'16841 at http://blogs.abi.org'),
	(4,1,'Preference Actions Filed in Open Range Bankruptcy','http://blogs.abi.org/node/16840','ABI Partner','<p>Last week, Charles M. Forman, acting as Chapter 7 Trustee (the “Trustee”) for Open Range Communications (“Open Range”) began filing complaints to recover what the Trustee contends are avoidable preferences. The Trustee filed the preference actions in the Delaware Bankruptcy Court and argues that the transfers, or payments, received by various defendants are avoidable and subject to recovery under 11 U.S.C. § 547 and 548 of the United States Bankruptcy Code. This post will look at the Open Range bankruptcy proceeding, why the company filed for bankruptcy as well as key developments during the course of the bankruptcy proceeding.<br />\nOpen Range is a Delaware corporation based out of Colorado. The company was founded in 2004 in order to provide broadband access to areas of the country that are underserved. <em>See</em> Open Range’s Declaration in Support of First Day Motions (the “Decl”) at *2. In 2009, Open Range executed a $267 million Loan and Security Agreement which it intended to use over a five year period to build broadband networks in over 500 communities in 17 states. Decl. at *3.<br />\nIn order to obtain wireless spectrum, in 2007 Open Range entered into a Spectrum Manager Lease with Globalstar Licensee LLC (“Globalstar”). After entering into the Spectrum Manager Lease, Globalstar experienced problems retaining the spectrum which Open Range intended to use for its services. Spectrum availability was critical to Open Range’s success as its loan agreement to fund operations was contingent on the continued availability of the wireless spectrum. Decl. at *3.</p>\n<p><a href=\"http://blogs.abi.org/node/16840\" target=\"_blank\">read more</a></p>',1381370691,'16840 at http://blogs.abi.org'),
	(5,1,'The True Cost Of Just Paying The Credit Card Minimum','http://blogs.abi.org/node/16842','ABI Partner','<p><a class=\"post_image_link\" href=\"http://www.bankruptcylawnetwork.com/the-true-cost-of-just-paying-the-credit-card-minimum/\" title=\"Permanent link to The True Cost Of Just Paying The Credit Card Minimum\"><img class=\"post_image alignright\" src=\"http://www.bankruptcylawnetwork.com/wp-content/uploads/Fotolia_53710363_XS.jpg\" width=\"424\" height=\"283\" alt=\"Post image for The True Cost Of Just Paying The Credit Card Minimum\" /></a><br />\nBankruptcy can seem so scary or humiliating that lots of folks resolve to just keep paying the minimums on their debts.<br />\nYou know what it feels like to have more bills than you can pay.  You don&#8217;t know how bankruptcy will affect you.<br />\nIt seems easier to stay the course, pay the minimums, and plod along.<br />\nIt may be sort of comfortable, and knowable, but it may be a <a title=\"Financial choices and personal responsibility\" href=\"http://www.bankruptcylawnetwork.com/mbna-ira-financial-choices-personal-responsibility/\"> life sentence</a> of being in debt.<br />\nYou won&#8217;t get ahead, for sure, but you  don&#8217;t have to face the uncomfortable fact  that you can&#8217;t really ever pay off  your debts.<br />\nOn the surface, it seems like a rational choice.</p>\n<ul>\n<li>It&#8217;s allowed by the terms of the credit card agreement.</li>\n<li>It saves you from looking at the big picture of your finances.</li>\n<li>You still have plastic in your wallet.</li>\n</ul>\n<p>But what&#8217;s the real and total cost to you of paying forever?</p>\n<p><a href=\"http://blogs.abi.org/node/16842\" target=\"_blank\">read more</a></p>',1381378778,'16842 at http://blogs.abi.org'),
	(6,1,'Hedge Funds Score Massive Return from Downey Financial Corp. Bankruptcy','http://blogs.abi.org/node/16844','ABI Partner','<p>Reuters today reported that Alden Global Capital, Davidson Kempner Capital Management, Halcyon Asset Management and Farallon Capital Management may have generated as much as a 1,000% return in a fight over a $373 million tax refund in the Downey Financial&#8230;Read more &#8250;</p>\n<p>Read the rest of this post on our website.<br />\n<a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=VAxBUw7K_b4:XCWnsZ2HtC0:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=VAxBUw7K_b4:XCWnsZ2HtC0:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/chapter11cases/~4/VAxBUw7K_b4\" height=\"1\" width=\"1\" /></p>',1381379022,'16844 at http://blogs.abi.org'),
	(7,1,'Has Sears Been Selling Off Some of its Most Profitable Stores?','http://blogs.abi.org/node/16843','ABI Partner','<p>The Wall Street Journal reported today that Sears has been doing just that. Find the WSJ story here: on.wsj.com/15lX44d</p>\n<p>Read the rest of this post on our website.<br />\n<a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=3eYKZm32pZ4:wiVweA32kFk:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=3eYKZm32pZ4:wiVweA32kFk:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/chapter11cases/~4/3eYKZm32pZ4\" height=\"1\" width=\"1\" /></p>',1381379128,'16843 at http://blogs.abi.org'),
	(8,1,'Hints at a Deal in Congress, But Fiscal Fallout Drags On','http://blogs.abi.org/node/16845','ABI Partner','<p>Receiving Wide Coverage ... </p>\n<p>A Deal to Be Had? Finally? All eyes remain fixed on Washington this week, as patience wears thin and lawmakers try to come up with an agreement to end the government shutdown and avert the looming debt ceiling. Democrats and Republicans have so far refused to negotiate with one another, but signs of a deal may be starting to emerge. (The game of chicken can only go on so long before the...</p>',1381410600,'16845 at http://blogs.abi.org'),
	(9,1,'The Daily Docket: Patriot Coal Sees Exit From Bankruptcy by Year End','http://blogs.abi.org/node/16847','ABI Partner','<p><a href=\"http://online.wsj.com/public/quotes/main.html?type=djn&amp;symbol=PCXCQ\">Patriot Coal</a> reached a settlement with Peabody Energy Corp. that provides funding for a union retiree benefits fund and will allow the coal mining company to exit bankruptcy by the end of the year. Read the story <a href=\"http://bankruptcynews.dowjones.com/Article?an=DJFDBR0020131010e9aacbtgr&amp;cid=3015003&amp;ctype=hs&amp;from=News\">in the Daily Bankruptcy Review</a>.<br />\nA bankruptcy judge on Wednesday said creditors can begin voting on the various plans to auction or reorganize beleaguered satellite company LightSquared Inc. Read the <a href=\"http://www.denverpost.com/breakingnews/ci_24274373/judge-sends-various-lightsquared-plans-creditors-vote\">DBR story in the Denver Post</a>.<br />\n<a href=\"http://online.wsj.com/public/quotes/main.html?type=djn&amp;symbol=OSGIQ\">Overseas Shipholding Group</a> plans to sue its former legal team for bad advice that forced the company to restate more than decade’s worth of financial results. Read the <a href=\"http://www.nasdaq.com/article/overseas-shipholding-to-sue-former-legal-counsel-over-tax-snafu-20131009-00966\">DBR story via Nasdaq</a>.<br />\n<a href=\"http://online.wsj.com/article/SB10001424052702304500404579125421906523350.html\">The Wall Street Journal says</a> hotel operator Kerzner International Holdings Ltd. is attempting a comeback with a colossal resort on the “Hawaii of China,” backed by a leading Chinese investor.</p>\n<p><a href=\"http://blogs.abi.org/node/16847\" target=\"_blank\">read more</a></p>',1381410964,'16847 at http://blogs.abi.org'),
	(10,1,'CFTC Rushes, Bungles Swap Market Reform; Industry Plays Along','http://blogs.abi.org/node/16846','ABI Partner','<p>With the CFTC on hiatus during the government shutdown, the industry should consider the damage that might be done to a market that has become an integral part of banking.</p>',1381424400,'16846 at http://blogs.abi.org'),
