	(64,5,'10th Circuit: Onyeabor v. Centennial Point Owners Association (In re Onyeabor)','http://feedproxy.google.com/~r/volo/rss/~3/0NUTJFLVxjU/onyeabor-v-centennial-point-owners-association-in-re-onyeabor','smulligan','<div class=\"field field-type-filefield field-field-cco-summary-pdf\">\n    <div class=\"field-items\">\n                      <div class=\"field-item odd circuit_court_opinion_pdf_button_wrapper\">\n          <a href=\"http://volo.abi.org/onyeabor-v-centennial-point-owners-association-in-re-onyeabor/opinion\" id=\"view_circuit_court_opinion\" class=\"circuit_court_opinion_pdf_button\" title=\"View the original Circuit Court opinion in PDF format\" target=\"_blank\">View opinion PDF</a><span id=\"circuit_court_opinion_link_separator\"> | </span><a href=\"http://volo.abi.org/onyeabor-v-centennial-point-owners-association-in-re-onyeabor/opinion/download\" id=\"download_circuit_court_opinion\" class=\"circuit_court_opinion_pdf_button\" title=\"Download the original Circuit Court opinion in PDF format\">Download opinion PDF</a>          </div>\n                </div>\n</div>\n<div class=\"field field-type-text field-field-cco-summary-citation\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Citation:&nbsp;</div>\n                              Onyeabor v. Centennial Pointe Owners Ass’n, et al., Case No. 13-4037 (10th Cir. October 9, 2013) (unpublished)        </div>\n        </div>\n</div>\n<div class=\"field field-type-text field-field-cco-summary-ruling\">\n      <div class=\"field-label\">Ruling:&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                              Conversion is appropriate where plan makes no provision for repayment of prepetition secured claims, where Debtor’s income is insufficient to support her plan or even the Appellees’ judgment lien, and where Debtor fails to address Tru