	(71,6,'The Cause and Effect of Municipal Insolvency and the Limits of Chapter 9','http://cle.abi.org/product/cause-and-effect-municipal-insolvency-and-limits-chapter-9','Matt','<div class=\"product-info product display\"><span class=\"uc-price-product uc-price-display uc-price\">$75.00</span></div><div class=\"product-body\"><p>This single plenary session will feature a policy-oriented panel discussing the reasons for municipal insolvency nationally, with a particular focus on the New England Region. The panel of highly-experienced government officials, municipal receivers and thought leaders will review and debate the challenges faced by state and local leaders in their efforts to address the financial stress facing many of our cities and towns.</p>\n</div><div class=\"product-info product sell\"><span class=\"uc-price-product uc-price-sell uc-price\">$75.00</span></div><div class=\"field field-type-text field-field-duration\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Duration:&nbsp;</div>\n                    90 mins        </div>\n        </div>\n</div>\n<div class=\"field field-type-link field-field-materials\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Materials:&nbsp;</div>\n                    <a href=\"http://materials.abi.org/sites/default/files/2013/Jul/CauseAndEffectMunicipalInsolvency.pdf\" target=\"_blank\">Members Only</a>        </div>\n        </div>\n</div>\n<div class=\"field field-type-content-taxonomy field-field-speakers\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Speakers:&nbsp;</div>\n                              100699        </div>\n              <div class=\"field-item even\">\n                      <div class=\"field-label-inline\">\n              Speakers:&nbsp;</div>\n                              100987        </div>\n              <div class=\"field-item odd\">\n                      <div class=\"field-label-inline\">\n              Speakers:&nbsp;</div>\n                              108068        </div>\n              <div class=\"field-item even\">\n                      <div class=\"field-label-inline\">\n              Speakers:&nbsp;</div>\n                              573257        </div>\n              <div class=\"field-item odd\">\n                      <div class=\"field-label-inline\">\n              Speakers:&nbsp;</div>\n                              573258        </div>\n              <div class=\"field-item even\">\n                      <div class=\"field-label-inline\">\n              Speakers:&nbsp;</div>\n                              573259        </div>\n        </div>\n</div>\n<div class=\"add-to-cart\"><form action=\"/taxonomy/term/1042/0/feed\"  accept-charset=\"UTF-8\" method=\"post\" id=\"uc-product-add-to-cart-form-477\">\n<div><input type=\"hidden\" name=\"qty\" id=\"edit-qty\" value=\"1\"  />\n<input type=\"submit\" name=\"op\" id=\"edit-submit-477\" value=\"Add to cart\"  class=\"form-submit node-add-to-cart\" />\n<input type=\"hidden\" name=\"form_build_id\" id=\"form-bb4ccfd2bb43e00867155b87e03e446b\" value=\"form-bb4ccfd2bb43e00867155b87e03e446b\"  />\n<input type=\"hidden\" name=\"form_id\" id=\"edit-uc-product-add-to-cart-form-477\" value=\"uc_product_add_to_cart_form_477\"  />\n\n</div></form>\n</div><p><a href=\"http://cle.abi.org/product/cause-and-effect-municipal-insolvency-and-limits-chapter-9\" target=\"_blank\">read more</a></p>',1374521422,'477 at http://cle.abi.org'),
	(72,1,'5 Things To Do When You Have Been Sued','http://blogs.abi.org/node/16848','ABI Partner','<p><a href=\"http://www.bankruptcysoapbox.com/wp-content/uploads/2013/10/process-server-badge.jpg\"><img class=\"alignright  wp-image-3283\" alt=\"process server badge\" src=\"http://www.bankruptcysoapbox.com/wp-content/uploads/2013/10/process-server-badge-300x298.jpg\" width=\"240\" height=\"238\" /></a>The ring on the doorbell was a process server.<br />\nBingo!  You&#8217;ve been sued.<br />\nNow what?<br />\nBreathe deeply and work your way through this five step check list.  Then I&#8217;ll suggest some options.<br />\n<strong>Look at the caption:</strong>  It identifies the parties to the suit.  It&#8217;s right below the centered name of the court involved.  The Plaintiff is the person filing the suit:  they have a comPLAINT for which they want the court&#8217;s help.<br />\nDo you recognize the plaintiff as one of your creditors?   If you don&#8217;t recognize the plaintiff, does the complaint explain how the plaintiff comes to assert someone else&#8217;s claim against you?<br />\n<strong>Find any verification:</strong>  Attached to the end of the complaint may be a verification.  This is a sworn statement by someone with personal knowledge of the facts that the facts set out in the complaint are true.  If there is no verification, you can file a simple form called a general denial if you want to contest the suit.<br />\n<strong>Mark your calendar:</strong>  In California, you have 30 days from service of the complaint to file an answer.  If you don&#8217;t file an answer, you are sure to lose the suit.</p>\n<p><a href=\"http://blogs.abi.org/node/16848\" target=\"_blank\">read more</a></p>',1381419275,'16848 at http://blogs.abi.org'),
	(73,1,'What Not to Do When Trying to Establish a $20 Million Value for Estate Property (Hint: Don’t Rely Solely on Google Earth)','http://blogs.abi.org/node/16851','ABI Partner','<p>Valuation fights in bankruptcy are often complex and highly technical affairs that, at times, can be rather dry.  This was not the case in <a title=\"In re Helena Christian School, Inc., No. 13-60091, (Bankr. D. Mont. September 16, 2013)\" href=\"http://business-finance-restructuring.weil.com/wp-content/uploads/2013/10/Helena-Christian-School-No-13-60091-Bankr-D-Mont-9-17-2013.pdf\" target=\"_blank\">In re Helena Christian School, Inc., No. 13-60091, (Bankr. D. Mont. September 16, 2013)</a>, in which the debtor’s valuation evidence hinged on printouts from Google Earth.<br />\nIn Helena Christian School, the debtor owed approximately $1.9 million to Mountain West Bank, N.A. pursuant to two promissory notes that were secured by a mortgage on 325 acres of undeveloped property owned by the debtor.  The bank moved for relief from the automatic stay in order to proceed with a foreclosure and liquidation of the property.  It argued that it was entitled to stay relief because the debtor lacked equity in the property, and, therefore, the bank did not have “adequate protection” against a diminution in value of the property during the bankruptcy.  The debtor opposed the motion, arguing that the value of the property exceeded the amount owed to the bank and that the equity cushion provided the Bank with “adequate protection.”</p>\n<p><a href=\"http://blogs.abi.org/node/16851\" target=\"_blank\">read more</a></p>',1381423622,'16851 at http://blogs.abi.org'),
	(74,1,'U.S. Isolating Itself from Global Payments System','http://blogs.abi.org/node/16852','ABI Partner','<p>As the world accelerates toward faster and contactless payments, the U.S. has been reinforcing checks, avoiding global payments standards and pursuing closed-loop innovations that further isolate it.</p>',1381424520,'16852 at http://blogs.abi.org'),
	(75,1,'Man Who Tampers with Grand Jury Witness and Commits Bankruptcy Fraud Sentenced','http://blogs.abi.org/node/16850','ABI Partner','<p><img align=\"left\" hspace=\"5\" width=\"100\" height=\"100\" src=\"http://allmandlaw.com/wp-content/uploads/2010/08/a9d6d0214bfabe789c03eaf96a6c2-150x150.jpg\" class=\"alignleft wp-post-image tfe\" alt=\" Imprisonment, Destitution and Other Misery\" title=\"\" />A Wisconsin man is ordered to pay close to $10,000 in fines and restitution, along with a 30 day jail sentence and four years of supervised released for tampering with a grand jury witness and bankruptcy.  Brett Pohle, 45, of Neillsville committed bankruptcy fraud by concealing information about his personal assets.  He later tried to [...]<br />\n<a href=\"http://feeds.feedburner.com/~ff/BankruptcyDallas?a=4tDTaf3xvu0:Ehrp0-oan7Y:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/BankruptcyDallas?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/BankruptcyDallas?a=4tDTaf3xvu0:Ehrp0-oan7Y:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/BankruptcyDallas?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/BankruptcyDallas/~4/4tDTaf3xvu0\" height=\"1\" width=\"1\" /></p>',1381435823,'16850 at http://blogs.abi.org'),
