	(77,1,'Don\'t Undermine Liquidity for the Sake of Capital','http://blogs.abi.org/node/16853','ABI Partner','<p>Proposals for a supplemental leverage ratio would treat cash, and the safest cash-like assets, like any risky asset. This may discourage banks from keeping their current high levels of liquidity.</p>',1381442460,'16853 at http://blogs.abi.org'),
