	(83,1,'New Bankruptcy Opinion: FINANCIAL INDUSTRY ASSOCIATION v. Securities and Exchange Commission – Dist. Court, MD Florida, 2013','http://blogs.abi.org/node/16917','ABI Partner','<p>FINANCIAL INDUSTRY ASSOCIATION, G&#038;G HOLDINGS, INC., RICHARD GOBLE and THE GOBLE FIRST REVOCABLE FAMILY TRUST MAY 13, 1999, Plaintiffs, v. SECURITIES AND EXCHANGE COMMISSION, FINANCIAL INDUSTRY REGULATORY AUTHORITY, INC., THE DEPOSITORY TRUST AND CLEARING CORPORATION, et al., Defendants. Case No.&#8230;Read more &#8250;</p>\n<p>Read the rest of this post on our website.<br />\n<a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=oPZw96RDw_E:EcZ1Q9J2qWc:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=oPZw96RDw_E:EcZ1Q9J2qWc:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/chapter11cases/~4/oPZw96RDw_E\" height=\"1\" width=\"1\" /></p>',1381803508,'16917 at http://blogs.abi.org'),
	(84,1,'New Bankruptcy Opinion: IN RE DDMG ESTATE – Dist. Court, D. Delaware, 2013','http://blogs.abi.org/node/16916','ABI Partner','<p>In re DDMG ESTATE, et al., Chapter 11, Debtors. WALT DISNEY STUDIOS MOTION PICTURE PRODUCTION, et al., Appellants, v. DDMG ESTATE, et al., Appellees. Bankr. No. 12-12568-BLS, Civ. No. 13-007-SLR. United States District Court, D. Delaware. October 1, 2013. MEMORANDUM&#8230;Read more &#8250;</p>\n<p>Read the rest of this post on our website.<br />\n<a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=OPmE2N31i4M:hNK9R2LuDw0:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=OPmE2N31i4M:hNK9R2LuDw0:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/chapter11cases/~4/OPmE2N31i4M\" height=\"1\" width=\"1\" /></p>',1381803541,'16916 at http://blogs.abi.org'),
	(85,1,'New Bankruptcy Opinion: IN RE SK FOODS, LP – Dist. Court, ED California, 2013','http://blogs.abi.org/node/16915','ABI Partner','<p>In Re: SK FOODS, L.P., a California Limited Partnership, Debtor. BRADLEY D. SHARP, Chapter 11 Trustee, Plaintiff, v. SEGAL &#038; KIRBY, LLP, Defendant. No. CIV. S-13-1363 LKK. United States District Court, E.D. California. September 30, 2013. ORDER LAWRENCE K. KARLTON,&#8230;Read more &#8250;</p>\n<p>Read the rest of this post on our website.<br />\n<a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=Cc4DFjzIvmU:wxcMq7UK6Lw:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=Cc4DFjzIvmU:wxcMq7UK6Lw:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/chapter11cases/~4/Cc4DFjzIvmU\" height=\"1\" width=\"1\" /></p>',1381803591,'16915 at http://blogs.abi.org'),
	(86,1,'New Bankruptcy Opinion: IN RE RESIDENTIAL CAPITAL, LLC – Bankr. Court, SD New York, 2013','http://blogs.abi.org/node/16914','ABI Partner','<p>In re: Residential Capital, LLC, et. al. Debtors. Case No. 12-12020 (MG). United States Bankruptcy Court, S.D. New York. October 4, 2013. MORRISON &#038; FOERSTER By: Gary S. Lee, Esq., Norman S. Rosenbaum, Esq., Jordan A. Wishnew, Esq., New York,&#8230;Read more &#8250;</p>\n<p>Read the rest of this post on our website.<br />\n<a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=UkDxtBDRIlE:BZQgxny7Oxw:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=yIl2AUoC8zA\" border=\"0\"></img></a> <a href=\"http://feeds.feedburner.com/~ff/chapter11cases?a=UkDxtBDRIlE:BZQgxny7Oxw:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/chapter11cases?d=qj6IDK7rITs\" border=\"0\"></img></a><br />\n<img src=\"http://feeds.feedburner.com/~r/chapter11cases/~4/UkDxtBDRIlE\" height=\"1\" width=\"1\" /></p>',1381803624,'16914 at http://blogs.abi.org'),
	(87,1,'Thoughts on Saving Your Miami or Broward Home from Foreclosure','http://blogs.abi.org/node/16883','ABI Partner','<p>It is reported in the media every day that many Miami and Broward homeowners are \"upside down\" or \"underwater\" with their homes. That is, they owe more on their mortgages than the value of the homes. Many homeowners financed their home on an \"80-20\" basis. That is, they borrowed 100% of the value of the home, structuring 80% of the borrowed sum into a first priority mortgage and 20% of the borrowed sum into a second priority mortgage. In many or most cases, the value of the home has fallen at least 20-30% at present and some experts expect a further substantial decline. </p>\n<p>What is the Miami or Broward homeowner to do? The recently passed $700 billion bailout package did not include a proposed bankruptcy code amendment that would have given the bankruptcy courts the power to modify and reduce mortgages on principal residences and reduce them to the fair market value of the home that serves as collateral. It also appears that the various well publicized federal programs have not been widely used for a variety of reasons. Many homeowners also report that they get the \"runaround\" when they attempt to contact their mortgage company to arrange a modification or workout. Many homeowners find that they are unable to modify their first priority mortgage due to the last of cooperation by the second priority mortgage holder. </p>\n<p><a href=\"http://blogs.abi.org/node/16883\" target=\"_blank\">read more</a></p>',1382067360,'16883 at http://blogs.abi.org'),
	(108,5,'9th Circuit: Utnehmer v. Crull (In re Utnehmer)','http://feedproxy.google.com/~r/volo/rss/~3/vrpEc2qcA58/utnehmer-v-crull-in-re-utnehmer','hmontesdeoca','<div class=\"field field-type-filefield field-field-cco-summary-pdf\">\n    <div class=\"field-items\">\n                      <div class=\"field-item odd circuit_court_opinion_pdf_button_wrapper\">\n          <a href=\"http://volo.abi.org/utnehmer-v-crull-in-re-utnehmer/opinion\" id=\"view_circuit_court_opinion\" class=\"circuit_court_opinion_pdf_button\" title=\"View the original Circuit Court opinion in PDF format\" target=\"_blank\">View opinion PDF</a><span id=\"circuit_court_opinion_link_separator\"> | </span><a href=\"http://volo.abi.org/utnehmer-v-crull-in-re-utnehmer/opinion/download\" id=\"download_circuit_court_opinion\" class=\"circuit_court_opinion_pdf_button\" title=\"Download the original Circuit Court opinion in PDF format\">Download opinion PDF</a>          </div>\n                </div>\n</div>\n<div class=\"field field-type-text field-field-cco-summary-citation\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Citation:&nbsp;</div>\n                              2013 WL 5573198 (B.A.P. 9th Cir. October 10, 2013)        </div>\n        </div>\n</div>\n<div class=\"field field-type-text field-field-cco-summary-ruling\">\n      <div class=\"field-label\">Ruling:&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                              Applying California partnership law, the Bankruptcy Appellate Panel (\"B.A.P.\") reversed the bankruptcy court because it erred when it decided that a partnership existed between the debtor defendant and plaintiff creditor based upon the terms of a loan agreement. As there ...        </div>\n        </div>\n</div>\n<div class=\"field field-type-text field-field-cco-summary-judges\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Judge(s):&nbsp;</div>\n                              Hon. Jim D. Pappas; Hon. Randall L. Dunn; Hon. Meredith A. Jury;  (U.S. Bankruptcy Appellate Panel, Ninth Circuit).  Appeal from a ruling by the Hon. Alan Jaroslovsky (Chief Bankruptcy Judge, Northern District of California)\n        </div>\n        </div>\n</div>\n<p><a href=\"http://volo.abi.org/utnehmer-v-crull-in-re-utnehmer\" target=\"_blank\">read more</a></p><img src=\"http://feeds.feedburner.com/~r/volo/rss/~4/vrpEc2qcA58\" height=\"1\" width=\"1\"/>',1381519509,'1396 at http://volo.abi.org'),
	(115,4,'ABI Bankruptcy Brief: Is Detroit\'s Bankruptcy a Bid to Bust Unions?','http://news.abi.org/briefs/abi-bankruptcy-brief-is-detroits-bankruptcy-a-bid-to-bust-unions','johnh','<div class=\"field field-type-date field-field-date\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <span class=\"date-display-single\">October 10, 2013</span>        </div>\n        </div>\n</div>',1381495372,'21954 at http://news.abi.org');
